import React, { Component } from "react";


class Card extends Component{
    constructor(props){
        super(props);
        this.state={
            id:1,
        }
    }
    render(){
        return (
            <div>
                <h2>{this.props.movies.title}</h2>
                
            </div>
        )
    }
}
export default Card;
